import { useState, useContext } from 'react';
import { useNavigate } from 'react-router-dom';
import { motion } from 'framer-motion';
import { ScanLine, LogIn, AlertCircle } from 'lucide-react';
import ConsistencyContext from '../context/ConsistencyContext';
import Card from '../components/ui/Card';

const LoginPage = () => {
  const [rfidInput, setRfidInput] = useState('');
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState('');
  const { loginUser } = useContext(ConsistencyContext);
  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!rfidInput.trim()) {
      setError('Please enter an RFID.');
      return;
    }
    setIsLoading(true);
    setError('');

    try {
      const success = await loginUser(rfidInput.trim());
      if (success) {
        navigate('/'); // Redirect to dashboard on successful login
      } else {
        setError('Invalid RFID or failed to load data.');
      }
    } catch (err) {
      console.error("Login error:", err);
      setError('An unexpected error occurred during login.');
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className="flex items-center justify-center min-h-screen bg-gradient-to-br from-indigo-100 via-purple-50 to-white p-4">
      <motion.div
        initial={{ opacity: 0, y: -30 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.5, ease: 'easeOut' }}
        className="w-full max-w-md"
      >
        <Card className="p-8 shadow-xl"> {/* Increased padding and shadow */}
          <div className="text-center mb-8">
             <ScanLine className="mx-auto text-indigo-600 h-12 w-12 mb-3" />
            <h1 className="text-2xl font-bold text-gray-800">Welcome to FitSplit</h1>
            <p className="text-gray-500 text-sm mt-1">Enter your RFID to access your dashboard.</p>
          </div>

          <form onSubmit={handleSubmit} className="space-y-6">
            <div>
              <label htmlFor="rfid" className="block text-sm font-medium text-gray-700 mb-1">
                RFID Identifier
              </label>
              <div className="relative">
                  <input
                    type="text" // Use text, can change to password if needed
                    id="rfid"
                    value={rfidInput}
                    onChange={(e) => setRfidInput(e.target.value)}
                    placeholder="Scan or type your ID"
                    disabled={isLoading}
                    className="w-full px-4 py-2.5 border border-gray-300 rounded-lg shadow-sm focus:ring-indigo-500 focus:border-indigo-500 transition duration-150 ease-in-out sm:text-sm disabled:opacity-50"
                    autoFocus // Auto focus on load
                  />
                  {/* Optional: Icon inside input */}
                  {/* <User className="absolute right-3 top-1/2 transform -translate-y-1/2 text-gray-400 h-5 w-5" /> */}
              </div>
            </div>

            {error && (
              <motion.div
                initial={{ opacity: 0 }}
                animate={{ opacity: 1}}
                className="flex items-center text-sm text-red-600 bg-red-50 p-3 rounded-lg border border-red-200"
              >
                 <AlertCircle className="h-5 w-5 mr-2 flex-shrink-0" />
                 <span>{error}</span>
              </motion.div>
            )}

            <div>
              <button
                type="submit"
                disabled={isLoading}
                className="w-full flex justify-center items-center py-2.5 px-4 border border-transparent rounded-lg shadow-sm text-sm font-medium text-white bg-indigo-600 hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-indigo-500 disabled:opacity-60 disabled:cursor-not-allowed transition duration-150 ease-in-out"
              >
                {isLoading ? (
                   <>
                     <motion.div
                        animate={{ rotate: 360 }}
                        transition={{ duration: 1, repeat: Infinity, ease: "linear" }}
                        className="mr-2"
                     >
                       <LogIn className="h-5 w-5" /> {/* Simple spin */}
                      </motion.div>
                      Authenticating...
                   </>
                ) : (
                  <>
                    <LogIn className="h-5 w-5 mr-2" /> Access Dashboard
                  </>
                )}
              </button>
            </div>
          </form>
        </Card>
      </motion.div>
    </div>
  );
};

export default LoginPage;
